import React from "react";

const Login = () => {
  return (
    <div className="login">
      <form className="login_from">
        <h1> Login :abacus:</h1>
        <input type="name" placeholder="name" />
        <input type="Email" placeholder="Email" />
        <input type="Password" placeholder="Password" />
      </form>
    </div>
  );
};
export { Login };
